text:
If you evacuated for #Florence, follow local officials to know when it's safe to go home.

If you're sheltering at home, stay inside until local officials say it's safe to go outside. Floodwaters may be contaminated &amp; can hide hazards like downed power lines.

@SCEMD @NCEmergency https://t.co/VMVXoissZY

